import React from "react";

const InfoList = () => {
  console.log();
  return (
    <table className="table table-bordered">
      <thead>
        <tr>
          <th>TODO</th>
          <th>PROJECT</th>
          <th>USERS</th>
        </tr>
      </thead>
      <tbody>
        <tr>{props.todos.length}</tr>
        <tr>{props.users.length}</tr>
        <tr>{props.projects.length}</tr>
      </tbody>
    </table>
  );
};

export default InfoList;
